	function calculateTimes()
	{
					if(latSelected!=="noval" && longSelected!=="noval" && gmtSelected!=="noval" )
					{
						var time= prayTimes.getTimes(new Date(), [latSelected, longSelected], gmtSelected,dst,format);
						prayTimes.adjust({asr:MaslakVal});
						//Fajr
						fajr = time.fajr;
						var minAdd=addtofajr%60;
						var hrAdd=parseInt(addtofajr/60);
						fajr=adjustTimes(fajr,minAdd,hrAdd);
						
						//Fajr
						
						//Dhuhr
						
						dhuhr = time.dhuhr;
						minAdd=addtozuhr%60;
						hrAdd=parseInt(addtozuhr/60);
						//alert(addtozuhr);
						//alert(hrAdd);
						dhuhr=adjustTimes(dhuhr,minAdd,hrAdd);
						//Dhuhr
						
						
						//Asr
						
						asr = time.asr;
						minAdd=addtoasr%60;
						
						hrAdd=parseInt(addtoasr/60);
					
						asr =adjustTimes(asr,minAdd,hrAdd);
						
						//Asr
						
						
						//Maghrib
						maghrib = time.maghrib;
						minAdd=addtomaghrib%60;
						hrAdd=parseInt(addtomaghrib/60);
						maghrib=adjustTimes(maghrib,minAdd,hrAdd);
					
						
						//Maghrib
						
						
						//Isha
						isha = time.isha;
						minAdd=addtoisha%60;
						hrAdd=parseInt(addtoisha/60);
						isha=adjustTimes(isha,minAdd,hrAdd);
						
						setmaintimes();	
						//alert(time.maghrib);
						
						return 1;
					}
					
						return 0;

	}
	
	function adjustTimes(namazTime,minAdd,hrAdd)
	{
						
						if(format==="12h")
						{
						
						hrAdd=hrAdd.toFixed(0);
						
						var ampm=namazTime.substr($.inArray(' ',namazTime)+1,2);
						
						//$.inArray(':',
						var hr=parseInt(namazTime.substr(0,$.inArray(':',namazTime)))+ parseInt(hrAdd);
						var min=parseInt(namazTime.substr($.inArray(':',namazTime)+1,$.inArray(' ',namazTime)-$.inArray(':',namazTime)+1))+minAdd;
					
						hr+=parseInt((min/60));
					
						
						min=min%60;
						if(min<0)
						{
						min=60+min;
						hr=hr-1;
						}
						
						
						
							if(hr>12)
							{
								hr=hr%12;
							}
						
						
						if(min<10&&min>=0)
						min=0+""+min;
						return hr+":"+ min +" "+ ampm;
						
						}
						else
						{
							var hr=parseInt(namazTime.substr(0,$.inArray(':',namazTime)))+ parseInt(hrAdd);
							var min=parseInt(namazTime.substr($.inArray(':',namazTime)+1,2))+parseInt(minAdd);
							
							hr+=parseInt((min/60));
					
						
								min=min%60;
								
								if(min<0)
								{
								min=60+min;
								hr=hr-1;
								}
						
						
						
							if(hr>24)
							{
								hr=hr%24;
							}
						
						
						if(min<10&&min>=0)
						min=0+""+min;
						return hr+":"+ min;
						}
	}

	
