Array.prototype.findindex=function(value)
{
	for(var i=0;i<this.length;i++)
	{
		if($.trim(this[i])===$.trim(value))
		{
			break;
		}
	}
	
	return i;
}

function setmaintimes()
	{
		$('#1')	.remove();
		$('#2')	.remove();
		$('#3')	.remove();
		$('#4')	.remove();
		$('#5')	.remove();
		$('<label id="1" style="none"><strong>'+fajr+'</strong></label>').appendTo('#fajr');
		$('<label id="2" style="none"><strong>'+dhuhr+'</strong></label>').appendTo('#duhr');
		$('<label id="3" style="none"><strong>'+asr+'</strong></label>').appendTo('#asr');
		$('<label id="4" style="none"><strong>'+maghrib+'</strong></label>').appendTo('#maghrib');
		$('<label id="5" style="none"><strong>'+isha+'</strong></label>').appendTo('#isha');
		
		
		setInterval("changetime()",1000);
	}

function changetime(){

		var currentdate= new Date();
		var hour= currentdate.getHours();
		var min = currentdate.getMinutes();
		var currenttime = hour+'.'+min;
		
		time= prayTimes.getTimes(new Date(), [latSelected, longSelected], gmtSelected,dst, "Float");
		
		var prayerscal=[time.fajr, time.dhuhr, time.asr, time.maghrib,time.isha];
		
				checkTimer(hour,min,fajr);
				checkTimer(hour,min,dhuhr);
				checkTimer(hour,min,asr);
				checkTimer(hour,min,maghrib);
				checkTimer(hour,min,isha);
				if(remainder===1)
				{
					min=min+remainderTime;
					if(min>60)
					{
						min=min%60;
						hour=hour+1;
					}

					checkTimerRem(hour,min,fajr);
					checkTimerRem(hour,min,dhuhr);
					checkTimerRem(hour,min,asr);
					checkTimerRem(hour,min,maghrib);
					checkTimerRem(hour,min,isha);
				}
				

		for(var i=0; i<prayerscal.length; i++)
		{
		
			if(prayerscal[i]>=currenttime)
			{
				$('#1')	.attr('style','');
				$('#2')	.attr('style','');
				$('#3')	.attr('style','');
				$('#4')	.attr('style','');
				$('#5')	.attr('style','');
				$('#'+(i+1)).attr('style', 'font-size:19px; color: #00FFFF; text-shadow: #000066 1px 1px 10px;');
				break;
			}
			
			if(i===4)
			{
				$('#'+(1)).attr('style', 'font-size:19px; color: #00FFFF; text-shadow: #000066 1px 1px 10px;');
			}
			
		}
		
}

	function checkTimer(hour,min,TimeNamaz)
	{
	
		if(format==="12h")
		{
			var hr=hour%12;
			var currentTime=hr+":"+min;
			
		//THIS 'substr' is causing trouble at start up!! But once the TIME is LOADED on main, this gets corrected.. Fix it ;/!	
		namazTime=TimeNamaz.substr(0,$.inArray(' ',TimeNamaz));
		}
		else
		{
			var hr=hour;
			var currentTime=hr+":"+min;
			namazTime=TimeNamaz;
		}
		
		
				
		if(namazTime.toString()===currentTime.toString() && ss===0)
		{
			
						Audio = document.createElement('audio');
						Audio.setAttribute('src', 'assets/'+srcAud);
						Audio.setAttribute('id', 'normalAzans1');
						Audio.volume= ($('#slider').val()/100);
						
		Audio.addEventListener('ended',function()
		{
		
			ss=0;
			$('#normalAzans1').remove();
		});
		
		Audio.play();
					
		ss=1;
					
		}
	
		
		
	}
	
	function checkTimerRem(hour,min,TimeNamaz)
